l;ren Lorenz (Tel 2270) Leiter IDRZ, Chief Information Officer</div>\n<div>Assistenz, Jeanette Jankwitz (Tel 2825) - https://www.geomar.de/idrz</div>\n<div>&nbsp;</div>\n<div>PEH Mo. 28.06.2021 10:17: FZ, WVL</div>\n<div>&nbsp;</div>\n<div>PEH Di. 29.06.2021 10:54: AP erreicht. RT+AWS und OCRE vorgestellt. AP kennt OCRE vage, da ein Forschungsbereich bereits damit arbeitet. AP hat Interesse an den AWS earth observation Daten und auch an der Auslagerung von Standard-IT Prozessen (\"&Uuml;berlaufmodell\").&nbsp; AP ist Gesamtleiter der IT- Im Bereich Kern-IT wird einer neuer Leiter im September starten, diesen will der AP mit ins Gespr&auml;ch nehmen. Auch der Leiter der Digitalen Forschungsdienste (Wissenschaftliches Rechnen mit Forschungsdaten) soll dabei sein. AP geht in 3 Tagen in den Urlaub. Er bittet um Zusendung von Informationen und Kontaktdaten an slorenz@geomar.de und Kontaktierung im August/September. Mailversand veranlasst. Lead&uuml;bergabe.</div>\n</div>\n<div>&nbsp;</div><div><span style=\"color: dodgerblue;\">24.11.2021</span>\\<span style=\"color: dodgerblue;\">15:23:29</span> <span style=\"color: dodgerblue;\">p.hertel@sales-people.de</span> : AB bei AP, WVL</div><div><span style=\"color: dodgerblue;\">7.12.2021</span>\\<span style=\"color: dodgerblue;\">16:34:21</span> <span style=\"color: dodgerblue;\">p.hertel@sales-people.de</span> : AP erreicht. AP erinnert sich an Gespr&auml;ch. IT-Leiter Hr. Ossama El Abbadi ist inzwischen die Position angetreten. Themen Earth Observation und Auslagerung von Standard-IT-Prozessen nach wie vor im Fokus. Ggf. weitere Themen. AP m&ouml;chte ein Mail mit Infos an slorenz@geomar.de erhalten, er wird sich dann mit Hr. El Abbadi kooridinieren und Terminvorschl&auml;ge f&uuml;r den Januar 2022 antworten. Mailversand angestossen. Lead&uuml;bergabe per Mail heute.</div>\n<div>Bitte folgenden Link mitsenden:https://aws.amazon.com/de/earth/</div><div><span style=\"color: dodgerblue;\">7.12.2021</span>\\<span style=\"color